import React from "react";

// Material UI
import theme from "../UI/Theme";
import { makeStyles } from '@mui/styles';
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';
import TextField from '@mui/material/TextField';

import logo from '../../assets/logo2.jpg';

const useStyles = makeStyles(theme => ({
  footer: {
    backgroundColor: theme.palette.common.darkBrown,
    width: "100%",
    height: "120px",
    zIndex: 1000,
    position: "relative",
    paddingTop: "4%",
    paddingBottom: "8%"
  },
  mainContainer: {
    position: "absolute",
    justifyContent: "space-around"
  },
  gridItem: {
    margin: "3em",

  },
  link: {
    color: theme.palette.common.white,
    fontWeight: 300,
    fontFamily: "Barlow",
    fontSize: "16px"
  },
  title: {
    color: theme.palette.common.white,
    fontWeight: 600,
    fontFamily: "Barlow"
  }
}))

const OutlinedButton = styled(Button)({
  ...theme.typography.buttonCustomization
})

const EmailTextField = styled((props) => (
  <TextField InputProps={{ disableUnderline: true }} {...props} />
))(({ theme }) => ({
  '& .MuiFilledInput-root': {
    border: '1px solid #e2e2e1',
    overflow: 'hidden',
    borderColor: theme.palette.common.white,
    borderRadius: 4,
    backgroundColor: theme.palette.mode === 'light' ? '#fcfcfb' : '#2b2b2b',
    transition: theme.transitions.create([
      'border-color',
      'background-color',
      'box-shadow',
    ]),
    '&:hover': {
      backgroundColor: 'transparent',
    },
    '&.Mui-focused': {
      backgroundColor: 'transparent',
      boxShadow: `${(theme.palette.primary.main, 0.25)} 0 0 0 2px`,
      borderColor: theme.palette.primary.main,
    },
  },
}));

const Footer = () => {
  const classes = useStyles()

  return (
    <footer className={classes.footer}>
      <Grid container className={classes.mainContainer}>
        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid item>
              Logo
            </Grid>
            <Grid item>
              FINTECHPORT LTD.
            </Grid>
            <Grid item className={classes.link}>
              Lorem ipsum dolor sit amet, consectetur adipiscing.
            </Grid>
            <Grid item className={classes.link}>
              Socail icons
            </Grid>
          </Grid>
        </Grid>

        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid item className={classes.title}>
              ACCOUNT
            </Grid>
            <Grid item className={classes.link}>
              Sign Up
            </Grid>
            <Grid item className={classes.link}>
              Log In
            </Grid>
            <Grid item className={classes.link}>
              Chat With Us
            </Grid>
          </Grid>
        </Grid>

        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid item className={classes.title}>
              LEARN MORE
            </Grid>
            <Grid item className={classes.link}>
              Esport (WMEGT)
            </Grid>
            <Grid item className={classes.link}>
              Privacy Policy
            </Grid>
          </Grid>
        </Grid>

        <Grid item className={classes.gridItem}>
          <Grid container direction="column" spacing={2}>
            <Grid item className={classes.title}>
              Subscribe to stay updated!
            </Grid>
            <Grid item className={classes.link}>
              <EmailTextField
                label="Email"
                id="outlined-size-small"
                defaultValue=" "
                size="small"
                color="secondary" 
              />
            </Grid>
            <Grid item className={classes.link}>
              <OutlinedButton variant="outlined" color="secondary">Subscribe</OutlinedButton>
            </Grid>
          </Grid>
        </Grid>

      </Grid>
    </footer>
  )
};

export default Footer;
